/**
 * Created by Lenovo on 2019/8/18.
 */
import React from 'react';
import './index.css';
export default class Button extends React.Component {
    constructor(props) {
        super(props);
    }
    onClick(index,item) {
        const {onClick} =this.props;
        if (onClick) {
            onClick();
        }
    }
    render() {
        const {type,children} =this.props;
        return(
            <div>
                <div className="cm-tx-c cm-mt-40">
                    <span className="cm-btn-small" onClick={()=>this.onClick()}>{children}</span>
                </div>
            </div>
        )
    }
}
